import { USER } from "./actionTypes";

export const dispatchDeal = (payload: number) => ({
    type: USER.DEAL,
    payload
});


export const dispatchJob = (payload: string) => ({
    type: USER.JOB,
    payload
});

export const dispatchCountry = (payload: string) => ({
    type: USER.JOB,
    payload
});
